package com.linyf.demo;

import com.linyf.demo.utils.Base64ImgUtil;
import org.apache.commons.codec.binary.Base64;

import java.io.*;

public class StringLengthDemo {
    public static void main(String[] args) throws IOException {
        ByteArrayOutputStream baos = new ByteArrayOutputStream();
        InputStream is = new FileInputStream(new File("C:\\Users\\fei62\\Pictures\\timg (2).jpg"));
        byte[] bytes = new byte[1024];
        int len = -1;
        while ((len = is.read(bytes))!=-1){
            baos.write(bytes,0,len);
        }

        String s = Base64.encodeBase64String(baos.toByteArray());
        System.out.println(s);
        System.out.println(s.length());
        Base64ImgUtil.GenerateImage(s, "C:\\Users\\fei62\\Pictures\\12345.jpg");
//        String aaa = "";

//        System.out.println(aaa);

    }
}
